public int compare(SchedulableEntity se1, SchedulableEntity se2) {
  Priority p1 = se1.getPriority();
  Priority p2 = se2.getPriority();
  if (p1 == null && p2 == null) {
    return 0;
  } else if (p1 == null) {
    return -1;
  } else if (p2 == null) {
    return 1;
  }
  return p1.compareTo(p2);
}
